import React from 'react';
import Header from './Header';
import Text from './Text';
import Social from './Social';
function App(){
    return(
        <div className='container'>
            <Header />
            <Text/>
            <Social/>.
            <h1>test</h1>
            <ul>
                <li>facebook</li>
                <li>youtube</li>
                <li>instagram</li>
            </ul>
        </div>
    );
}
export default App;
